import img_ico from '../../assets/ico/list_img_ico';
import './Footer.css';

const Footer = () =>{
    return(
        <ul className='ico_list'>
            <li><img src={img_ico[0].img} alt={img_ico[0].alt}/></li>
            <li><img src={img_ico[1].img} alt={img_ico[1].alt}/></li>
            <li><img src={img_ico[2].img} alt={img_ico[2].alt}/></li>
            <li><img src={img_ico[3].img} alt={img_ico[3].alt}/></li>
            <li><img src={img_ico[4].img} alt={img_ico[4].alt}/></li>
            <li><img src={img_ico[5].img} alt={img_ico[5].alt}/></li>
        </ul>
    );
}

export default Footer;
